import defineDumbElement from './defineDumbElement.js';

function defineImg(tag, img) {
	defineDumbElement(tag, `
		<style>
			:host {display: inline-block;}
			img {
				width: inherit;
				height: inherit;
			}
		</style>
		<img src="${img}" alt="Thorsten Roggendorf">
	`);
}

function defineCert(tag, img) {
	defineDumbElement(tag, `
		<style>
			:host {
				display: block;
				width: inherit;
			}
			img {
				width: inherit;
				height: inherit;
			}
		</style>
		<img src="${img}" alt="">
	`);
}

defineCert('abi1','data:image/jpg;base64,');
defineCert('abi2','data:image/jpg;base64,');
defineCert('abi3','data:image/jpg;base64,');
defineCert('abi4','data:image/jpg;base64,');
defineCert('diplom1','data:image/jpg;base64,');
defineCert('diplom2', 'data:image/jpg;base64,');
defineCert('echelon1', 'data:image/png;base64,');
defineCert('echelon2', 'data:image/png;base64,');
defineCert('promotion', 'data:image/jpg;base64,');
defineImg('portrait', 'data:image/jpg;base64,');
defineImg('signature', 'data:image/jpg;base64,');
